import React, { Component } from 'react';

const axios = require('axios')

class App extends Component {
    constructor(props){
        super(props);
        this.state = {
            words: [],
            frequencyCount: []
        }
        this.words = [];
        this.x = ''
    }
    componentDidMount(){
        axios.get('http://localhost:5001/api/api')
            .then((response) => {
                console.log(response)
                this.setState( state => ({
                    ...state,
                    words: this.state.words.concat(response.data.words),
                    frequencyCount: this.state.words.concat(response.data.frequencyCount)
                }))
            })
            .catch(function (error) {
                console.log(error);
            });
            this.x = 'yash'
    }

    render() {
        console.log(this.state)
        var i = 0;
        var words = this.state.words.map( w => {
            i++;
            return <p key={i}>{w}</p>
        })
        return (
            <div className="App">
                {words}
            </div>
        );
    }
}

export default App;
